import './App.css';
import Alo from './Fondos/1.png'
import Centro from './Fondos/Centro.png'

function App() {
  return (
    <div className='Main'>
      <img className='Alo' src={Alo} alt='Alo'/>
      <img className='Center' src={Centro} alt='Centro'/>
    </div>
  );
}

export default App;
